import React from "react";
import ReactDOM from "react-dom/client";
import App from "./App";
import { WeatherCard } from "./components/WeatherCard";
import { Footer } from "./components/Footer";

const root = ReactDOM.createRoot(
  document.getElementById("root") as HTMLElement
);
root.render(
  <React.StrictMode>
    <App />
    <WeatherCard temperature={36.6} date={"2023-05-18"} />
    <WeatherCard temperature={30.2} date={"2023-05-19"} />
    <WeatherCard temperature={31.1} date={"2023-05-20"} />
    <WeatherCard temperature={39.7} date={"2023-05-21"} />
    <WeatherCard temperature={40.5} date={"2023-05-22"} />
    <WeatherCard temperature={38.0} date={"2023-05-23"} />
    <Footer />
  </React.StrictMode>
);
